import { put, takeEvery } from 'redux-saga/effects';
import * as actions from '../actions';

export function* ServiceData() {
    console.log("submit------services");
    yield put(actions.ServiceData.request());
    try {
        console.log("SUCCESS-SAGA_DASHBOARD")
        let objArray = [
            { id: 1, serviceName: "FrontOffice" },
            { id: 2, serviceName: "HouseKeeping" },
            { id: 3, serviceName: "All Day Dining" },
            { id: 4, serviceName: "Bed, Bath & More" },
            { id: 5, serviceName: "Other Services" }
        ]
        // const response = [{ id: 1, serviceName: FrontOffice },]
        yield put(actions.ServiceData.success(objArray));
    } catch ({ error }) {
        yield put(actions.ServiceData.read.failure(error));
    }
}

export function* watchServiceData() {
    yield takeEvery(actions.LOAD_SERVICE, ServiceData);
}

export default watchServiceData
